import React from "react";

function Chats() {
  return (
    <div className="chats">
      <div className="userChat">
        <img
          src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTz0Gz2ajACDzLuPURTckEBJfbaC2WO3eaeWUZW6eNXmKubYdEY"
          alt=""
        />
